import React from 'react';
import './intro.css';
import bg from'../../assets/image.png.jpg';
import { Link } from 'react-scroll';

const Intro = () => {
  return (
    <section id='intro'>
        <div className='Introcontent'>
            <span className='hello'>Hello,</span>
            <span className='IntroText'>I'm <span className='IntroName'>Reuben<br/>website designer</span></span>
            <p className='introPara'>i am a skilled webdesigner with experience in creating visually appealing and user friendly websites</p>
            <Link><button className='btn'><img src='' alt=''/>Hire Me</button></Link>

        </div>
        <img src={bg}alt='profile'className='bg'/>
    </section>
  )
}

export default Intro;
